import React from 'react';
import './css/resourcesPage.css'; // Assuming you've created this new CSS file

function ResourcesPage() {
  const resources = [
    { name: 'Budgeting', icon: 'icon-url-here', link: '#', color: 'red' },
    // Add all your other resources here...
  ];

  return (
    <div className="resources-container">
      <h2>Resources</h2>
      <div className="resources-grid">
        {resources.map(resource => (
          <a href={resource.link} className="resource-card" style={{ backgroundColor: resource.color }}>
            <img src={resource.icon} alt={resource.name} />
            <span>{resource.name}</span>
          </a>
        ))}
      </div>
      {/* More content can be added here if needed */}
    </div>
  );
}

export default ResourcesPage;
